import React from 'react';
import Menu from './Menu';
import MenuItem from './MenuItem';

const SnackPage = () => {
  const snackItems = ['Chips', 'Cookies', 'Pretzels'];
  const drinkItems = ['Soda', 'Juice', 'Water'];

  return (
    <div>
      <Menu items={snackItems} itemName="Snack" />
      {snackItems.map((item, index) => (
        <MenuItem key={index} itemName={item} />
      ))}

      <Menu items={drinkItems} itemName="Drink" />
      {drinkItems.map((item, index) => (
        <MenuItem key={index} itemName={item} />
      ))}
    </div>
  );
};

export default SnackPage;
